import styled from "styled-components"

const ResultsList = ({ results, handleSongSelect }) => {
  return (
    <ListContainer>
      {results.map(result => 
        <ListItem key={result.id} onClick={() => handleSongSelect(result.id)}>
          <img src={result.header_image_thumbnail_url} alt={`thumbnail`} />
          <span> {result.full_title} </span>
        </ListItem>
      )}
    </ListContainer>
  )
}

const ListContainer = styled.ul``
const ListItem = styled.li``

export default ResultsList
